SET standard_conforming_strings = OFF;
DROP TABLE IF EXISTS "public"."countries_un" CASCADE;
BEGIN;
CREATE TABLE "public"."countries_un" ( "ogc_fid" SERIAL, CONSTRAINT "countries_un_pk" PRIMARY KEY ("ogc_fid") );
SELECT AddGeometryColumn('public','countries_un','geometry',4326,'MULTIPOLYGON',2);
CREATE INDEX "countries_un_geometry_geom_idx" ON "public"."countries_un" USING GIST ("geometry");
ALTER TABLE "public"."countries_un" ADD COLUMN "status" VARCHAR;
ALTER TABLE "public"."countries_un" ADD COLUMN "name" VARCHAR;
ALTER TABLE "public"."countries_un" ADD COLUMN "continent" VARCHAR;
ALTER TABLE "public"."countries_un" ADD COLUMN "region" VARCHAR;
ALTER TABLE "public"."countries_un" ADD COLUMN "fid" NUMERIC(10,0);
ALTER TABLE "public"."countries_un" ADD COLUMN "region_id" NUMERIC(10,0);
COMMIT;
